//Moving and zooming the image don't work for the moment
function moveZoom(x,y) {
    var zoomImage = document.getElementById('bodyImage');
    
    zoomImage.style.transformOrigin = 'top left';

    coordStr = zoomImage.style.objectPosition;

    var matches = coordStr.match(/-?\d+/g);

    var posX = parseInt(matches[0], 10) + x;
    var posY = parseInt(matches[1], 10) + y;

    zoomImage.style.objectPosition = '' + posX + 'px ' + posY + 'px';

    updateDotPosition(x, y);
}

function Zoom(z) {
    var zoomImage = document.getElementById('bodyImage');
    var zoomScale = zoomImage.style.transform;
    var nombre = parseFloat(zoomScale.match(/\d+/)[0]) + z;
    zoomImage.style.transform = 'scale(' + nombre + ')';  
    var yd = 47;
    if(nombre == 2){
        yd = 47/nombre;//23.5
    }
    if(nombre == 3){
        yd = 7;
    }
    if(nombre == 4){
        yd = 4
    }

    updateDotPosition(0, -yd, z);
}


function updateDotPosition(x, y, z = 0) {
    var zoomImage = document.getElementById('bodyImage');
    var zoomScaleStr = zoomImage.style.transform;
    var zoomScale = parseFloat(zoomScaleStr.match(/\d+/)[0]); 

    var clickdot = document.getElementById("clickDot");
    var dotLeft = parseInt(clickdot.style.left || 0);
    var dotTop = parseInt(clickdot.style.top || 0);

    var zooming = 1;
    if(z>0){
        zooming=zoomScale/(zoomScale-1);
    }
    if(z<0){
        zooming=zoomScale/(zoomScale+1);
    }
    
    clickdot.style.left = dotLeft*zooming + x*zoomScale + 'px';
    clickdot.style.top = dotTop*zooming + y*zoomScale + 'px';

    var dots = document.querySelectorAll(".Dot");
    dots.forEach(function(dot) {
        var dotLeft = parseInt(dot.style.left || 0);
        var dotTop = parseInt(dot.style.top || 0);
    
        dot.style.left = dotLeft*zooming + x*zoomScale + 'px';
        dot.style.top = dotTop*zooming  + y*zoomScale + 'px';
    });
}



function selectArea(text) {
    document.getElementById('selectedArea').value = text;
    
}

function addSelectedArea() {
    //Add the last area clicked to the list off location
    //and create a new dot to add the next location if needed
    var oldclickDot = document.getElementById("clickDot"); 
    oldclickDot.id = "Dot";
    oldclickDot.classList.add("Dot");

    var newclickDot = document.createElement("div");
    newclickDot.id = "clickDot";
    newclickDot.style.height = 10 + 'px';
    newclickDot.style.width = 10 + 'px';
    
    var map = document.getElementById("bodyChart"); 
    map.appendChild(newclickDot);

    document.getElementById('painLocations').value += document.getElementById('selectedArea').value + "; ";
}


function displayClickDot(event) { 
    //display a red where the image is click
    //and write the areas corresponding
    var x = event.offsetX; // X coordinate of the click
    var y = event.offsetY; // Y coordinate of the click
    var dot = document.getElementById('clickDot');
    dot.style.visibility = 'visible';
    dot.style.left = x + 'px'; // Position the dot horizontally
    dot.style.top = y + 'px'; // Position the dot vertically

    var dotSize = document.getElementById('slider').value;
    dot.style.height = dotSize + 'px';
    dot.style.width = dotSize + 'px';
    
    var zoomImage = document.getElementById('bodyImage');
    var zoomScaleStr = zoomImage.style.transform;
    var zoomScale = parseFloat(zoomScaleStr.match(/\d+/)[0]); 
    var zone = "";
    x = x/zoomScale;
    y = (y/zoomScale)-47;
    xStr = Math.round(x).toString();

    for (var color in layer1[xStr]) {
        for(var range of layer1[xStr][color]){
            if(y >= range[0] && range[1] >= y){
                zone += colorToCode(color) + " ";
            }
        }
    }
    for (var color in layer2[xStr]) {
        for(var range of layer2[xStr][color]){
            if(y >= range[0] && range[1] >= y){
                zone += colorToCode(color);
            }
        }
    }
    selectArea(zone);
}

function colorToCode(color){
    if(color == "(77, 209, 250)"){return "T";}
    else if(color == "(211, 77, 250)"){return "C";}
    else if(color == "(79, 77, 250)"){return "S";}
    else if(color == "(250, 188, 77)"){return "L";}

    else if(color == "(235, 236, 94)"){return "OB";}       //Ophthalmic Branch
    else if(color == "(236, 184, 94)"){return "MaxiB";}    //Maxillary Branch
    else if(color == "(236, 131, 94)"){return "MandB";}    //Mandibular Branch
    else if(color == "(218, 2, 27)"){return "TC";}         //Transverse Cervical
    else if(color == "(218, 2, 108)"){return "SC";}        //Supraclavicular
    else if(color == "(153, 67, 141)"){return "LTR";}      //Lateral Thoracic Ramj?
    else if(color == "(253, 77, 229)"){return "A";}        //Axillary
    else if(color == "(34, 33, 77)"){return "MBC";}        //Medial Branchial Cutaneous
    else if(color == "(77, 143, 253)"){return "LBC";}      //Lateral Brachial Cutaneous
    else if(color == "(68, 67, 153)"){return "MAC";}       //Medial Antebrachial Cutaneous
    else if(color == "(77, 209, 253)"){return "LAC";}      //Lateral Antebrachial Cutaneous
    else if(color == "(211, 77, 253)"){return "R";}        //Radial
    else if(color == "(167, 2, 218)"){return "M";}         //Median
    else if(color == "(145, 77, 253)"){return "U";}        //Ulnar
    else if(color == "(175, 127, 45)"){return "LFC";}      //Lateral Femoral Cutaneous
    else if(color == "(77, 253, 232)"){return "O";}        //Obturator
    else if(color == "(66, 196, 24)"){return "F";}         //Femoral
    else if(color == "(2, 151, 21)"){return "CP";}         //Common Peroneal
    else if(color == "(104, 253, 123)"){return "Saph";}    //Saphenous
    else if(color == "(94, 236, 165)"){return "SP";}       //Superpicial Peroneal
    else if(color == "(79, 77, 253)"){return "Sural";}     //Sural
    else if(color == "(205, 254, 211)"){return "DP";}      //Deep Peroneal
    else if(color == "(253, 77, 163)"){return "ATR";}      //Anterior Thoracic Ramj?
    else if(color == "(83, 1, 109)"){return "+";}          //?
    else if(color == "(238, 186, 254)"){return "x";}       //?
    else if(color == "(186, 253, 77)"){return "*";}        //?

    else{return "?";} 
}


